package org.meditation.ez4h.mcjava.cache;

public class EntityInfo {
    public float x,y,z;
    public int id;
    public String type;
    public EntityInfo(float x,float y,float z,int id,String type){
        this.x=x;
        this.y=y;
        this.z=z;
        this.id=id;
        this.type=type;
    }
}
